import React from 'react';
import Rightbar from './components/Rightbar';
import Sidebar from './components/Sidebar';
import Feed from './components/Feed';
import { Box, Container, Stack } from '@mui/system';

export const App = () => {
  return (
    <Container
      sx={{
        backgroundColor: 'red',
      }}
    >
      <Stack></Stack>
      <Sidebar />
      <Feed />
      <Rightbar />
    </Container>
  );
};
export default App;
